import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
    const expenseItem_ = props.expenses.map(
        item=>{
            return (
              <ExpenseItem
               title={item.title}
               amount={item.amount}
               date ={item.date}
              />
            )
          }
    );

    return (
        {expenseItem_}
    )
}
export default Expenses;
